import React from 'react'
import { useNavigate, useParams } from 'react-router-dom'

function SingleJob() {
    let {id} = useParams()
    console.log(useParams())

    const navigate = useNavigate()
    console.log(id?'hello':"by")
    if(!id){
        navigate("http://localhost:3000")
    }
  return (
    <div>SingleJob</div>
  )
}

export default SingleJob
